Since $\sin \angle RPQ = \frac{7}{25}$, we have that $\angle RPQ$ is the angle in a right triangle with opposite side length 7 and hypotenuse length 25. By the Pythagorean Theorem, the adjacent side length is $\sqrt{25^2 - 7^2} = 24$.

