[/asy]

Since $\angle RPS$ is the complement of $\angle RPQ$, $\cos \angle RPS = \sin \angle RPQ = \boxed{\frac{7}{25}}$. Final Answer: $\boxed{\frac{7}{25}}$. I hope it is correct.

